import React ,{useState,useContext}from 'react'
import { ProductContext } from '../Global/ProductContext'
import Search  from './Search';
import { Link } from 'react-router-dom';
import { CartContext } from '../Global/CartContext';
const Navbar = () => {
    const [isMobile, setIsMobile] = useState(false);
  const {qty}=useContext(CartContext);
  const {products}= useContext(ProductContext);
  console.log(products);
    return (
        <>  
          <div className="headerLine">
             <div className={isMobile ? "nav-link-mobile" : "nav-links"}>
                <ul className="left">
                    <li><Link to="/">Achar</Link></li>
                </ul>
                <ul className="product-nav">
                    <li><Link to="/"></Link></li>
                </ul>
                <ul className="connect-nav">
                    <li><Link to="/contact">CONTACT</Link></li>
                </ul>
                <ul className="about-nav">
                    <li><Link to="/about">ABOUT</Link></li>
                </ul>

                <ul className="#">
                    <li><Search/></li>
                </ul>
                {/* <div className="#"><Search/></div> */}


                <ul className="right">
                    <li><Link to="cart"><span className="shopingLogo"><i class="fas fa-shopping-cart"></i><span className="cartCount">{qty}</span></span></Link></li>
                </ul>
                <button className="mobile-menu-icon">
                    {isMobile ? (
                        <i className="fas-fa-times"></i>
                    ):(
                        <i className="fas-fa-bars"></i>

                    )}

                </button>
            </div>    
             </div>  
        </>
    )
}

export default Navbar;
